from sympy import divisors, integer_nthroot
def A302293(n):
    s = set()
    for i in range(1,n):
        for j in divisors(i):
            if integer_nthroot(j,2)[1]:
                for k in divisors(n-i):
                    s.add((j,k))
    return len(s) # _Chai Wah Wu_, May 26 2018

